function getOccupancyGrid() {

	var mapObject = this.get('map'); 
	var imageData = mapObject.grid;
	width = mapObject.width;
	height = mapObject.height;  
	var binaryThresholding = this.getParameter('binaryImage');
	image = new BufferedImage(width, height, BufferedImage.TYPE_INT_ARGB);
	for (var y = 0; y < height; y++) {
		for (var x = 0; x < width; x++) { 
			var index = x + y*width;
			var pixel = imageData[index];

			if (pixel < 0) {
				// Opaque red for unknown
				image.setRGB(x, y, 4294901760);
			} else {
				var intensity;
				if ( binaryThresholding ) {
					if ( pixel >= 255) {
						intensity = 255;
					} else if ( pixel <= 100) {
						intensity = 0;
					} else {
						intensity = 127;
					}
				} else {
					intensity = pixel;
				}
				// To make the color opaque:
				var alpha = 4278190080; 
				var color = alpha + intensity * (65536 + 256 + 1);
				image.setRGB(x, y, color);
			}
		}
	} 
	this.send('image', image);
}
